Ever been to @intlmktplace? If you haven’t you are totally missing out! The International Market Place has over 90 stores and restaurants in the heart of Waikiki— you can literally shop till you drop 😍👏🏽💥

I had the amazing opportunity to shop during Pride weekend at some of my fav stores at International Market Place:

@abercrombie_hawaii_ 
@burberryhawaii 
@chapelhatsoahu 
@mauidiversjewelry 

Talk about a day well spent here in Waikiki 🤩✨

If you’re ever in #Waikiki be sure to stop by the International MarketPlace, a proud ally of the LGBTQ+ community! There is something for everyone and the architecture itself is magnificent with an amazing story behind it! #MarketPlaceStories

Happy ❤️s day my cuties! You’re all my #valentine 😘❤️

@mileycyrus says you can buy yourself 💐 but they wilt…. so here i am buying balloons, wine, chocolates, & everything else i want cause why tf not 🥰❤️😍 

